export default function Benefits() {
  const [hoveredCard, setHoveredCard] = useState<string | null>("frame1");
  const debounceTimerRef = useRef<NodeJS.Timeout | null>(null);

  const debouncedSetHoveredCard = (card: string | null) => {
    if (debounceTimerRef.current) {
      clearTimeout(debounceTimerRef.current);
    }

    debounceTimerRef.current = setTimeout(() => {
      setHoveredCard(card);
    }, 150); // 150ms debounce delay
  };

  const clearHoveredCard = () => {
    if (debounceTimerRef.current) {
      clearTimeout(debounceTimerRef.current);
    }
    debounceTimerRef.current = setTimeout(() => {
      setHoveredCard("frame1");
    }, 150); // 150ms debounce delay when clearing
  };

  useEffect(() => {
    return () => {
      if (debounceTimerRef.current) {
        clearTimeout(debounceTimerRef.current);
      }
    };
  }, []);

  return (
    <section
      className="bg-[#e8f9ff] block relative size-full max-[1023px]:min-h-[1800px] overflow-hidden"
      data-name="Benefits"
    >
      <Frame1 hoveredCard={hoveredCard} setHoveredCard={debouncedSetHoveredCard} clearHoveredCard={clearHoveredCard} />
      <Frame2 hoveredCard={hoveredCard} setHoveredCard={debouncedSetHoveredCard} clearHoveredCard={clearHoveredCard} />
      <Frame3 hoveredCard={hoveredCard} setHoveredCard={debouncedSetHoveredCard} clearHoveredCard={clearHoveredCard} />
      <Frame4 />
    </section>
  );
}